import React from 'react'
import { useState } from 'react'
import { useEffect } from 'react'
const Pagination = () => {

    const [letApi, setLetApi] = useState([])
   const [currentpage,setCurrentpage]= useState(1)
   const [blogpage, setBlogpage]  = useState(20)
   const firstpage = currentpage * blogpage
   const lastpage= firstpage- currentpage
   const pagesresult= letApi.slice(lastpage,firstpage)
    useEffect(() => {
      fetch('https://jsonplaceholder.typicode.com/posts')
      .then(response => response.json())
      .then(data => setLetApi(data))
    
    },[])
    

  return (

       <div>
          <div>
            {pagesresult.map(({id,title,body})=>{
            return(
                
                <div key={id}>
                    <div style={{background:'pink '}}>  
                    <h1>{id}</h1>
                    <h1>{title}</h1>
                    <h1>{body}</h1>
                </div>
                </div>
                )
         })}
       </div> 
       <div>
          {/* <button onClick={first}>firstpage</button> */}
          <button>secondpage</button>
          <button>Thirdpage</button>
          <button>fouthpage</button>
       </div>
     </div>   
         
            


    
  )
}

export default Pagination
